window.bookSummaryJSON = "<p>To an omega, finding the pack that’s the perfect scent match is the ultimate dream.</p> <p>But what happens when your mates turn out to be your cheating ex-boyfriend’s dads?</p> <p>Welcome to the chaotic mess that is my life.</p> <p>My name is Daria and my scent matches are off limits.</p> <p>I’d sworn off love for good but fate had other plans. One night of debauchery at an exclusive adult club changed the course of my life.</p> <p>Forever.</p> <p>Society says it isn’t right to be with them, but I’ve never been good at following the rules, and there’s something about this pack that sets my soul on fire.</p> <p>Will fate be enough to keep us together or will my complicated past rip us apart?</p> <p>This will be a standalone romance set in the Forbidden Scents world.</p>"; 
